     */
    rewards: function getLegacyRewards({ region, ...args }) {
      return this.blizzard.get(`/sc2/legacy/data/rewards/${region}`, args);
    }.bind(this),
  };
};

/**
 * Fetch Starcraft 2 ladder data.
 *
