  return this.blizzard.get(`/sc2/metadata/profile/${region}/${realm}/${profile}`, args);
};

/**
 * Fetch Starcraft 2 profile data.
 *
 * @param {Object} args
 * @param {Number} args.profile The profile ID
 * @param {Number} args.realm The realm ID
